/**
 * A hand-written implementation of something could that be done
 * with Rambda.
 * @param {*} Person A person with the age property.
 * @return {Boolean} Is the person older or equal to 30?
 */
export const isOldEnough = ({ age }): boolean => {
  return age > 30;
};

import { isOldEnough } from '../sample';

describe('isOldEnough', () => {
  it('should return true if old enough', () => {
    expect(isOldEnough({ age: 35 })).toEqual(true);
  });
});
